import React from "react"

function TeamMember(props){
    return(
        <div className="col-md-4 col-sm-6 border">
            <div className="card">
                <div className="card-header"></div>
                <div className="card-body">
                <div className="card-header"></div>
                </div>
            </div>
        </div>
    )
}

export default TeamMember ;
